import React from "react";
import Card from "../UI/Card";
import services1 from '../assets/services1.jpg'
import "../css/pricing.css";

const Pricing = () => {
  return (
    <div className="pricing-wrapper" id="pricing">
      <h3>
        <box-icon name="cut" size="3rem" animation="tada"></box-icon>Our
        Services
      </h3>
      <div className="pricing">
        <Card img={services1} title="Hair & Beard Styling" description="xxx" />
        <Card
          img={services1}
          alt="img-2"
          title="Hair Color & Styling"
          description="xxx"
        />
        <Card
          img={services1}
          alt="img-3"
          title="Hair Styling"
          description="xxx"
        />
        <Card
          img={services1}
          alt="img-4"
          title="Beard Styling"
          description="xxx"
        />
      </div>
    </div>
  );
};

export default Pricing;
